import React from 'react';
import axios from 'axios';
import 'antd/dist/antd.css';
import './index.css';
import ReactDOM from 'react-dom';
import { Button, Tree } from 'antd';
import logo from './logo.jpeg'; // with import

class Call extends React.Component{
 
    

  render() {
    return (
      <div>
      <div style={{display: 'flex',justifyContent:'center', alignItems:'center',flexDirection: "vertical",fontSize: 10 ,backgroundColor:"white", marginTop :'20px'}}>
        <Button 
          type="primary"
          onClick={this.handleClick}>
          SHOW
        </Button>
      </div>
        {this.set_image()}
      </div>
    );
  }
}

export default Call;
